GMAT_Top___Bottom_Qu_2.query:
q = load "${App.Datasets.RA_Test_Scores_tp.FullyQualifiedName}";
q = filter q by 'hed__Test_Type__c' == "GMAT";
result = group q by 'hed__Subject_Area__c';
result = foreach result generate q.'hed__Subject_Area__c' as 'hed__Subject_Area__c', avg(q.'hed__Score__c') as 'A', case
when q.'hed__Subject_Area__c' == "Overall" then 01
when q.'hed__Subject_Area__c' == "Mathematics" then 02
when q.'hed__Subject_Area__c' == "Language" then 03
else 04
end as 'B', avg(q.'hed__Score__c') as 'C', stddev(q.'hed__Score__c') as 'E';
result = foreach result generate 'hed__Subject_Area__c', 'A', 'B', 'C', 'E', percentile_disc(0.95) within group (order by A) as 'D';
result = order result by ('B' asc);
result = limit result 2000;
